import { Layout, theme } from "antd";
import React from "react";
import { Card } from "react-bootstrap";

const AppContent = ({ changeColor }) => {
  const { Content } = Layout;
  const {
    token: { colorBgContainer },
  } = theme.useToken();
  return (
    <div>
      <Content
        className="fs-5"
        style={{
          margin: "12px",
          padding: 24,
          height: "88vh",
          background: colorBgContainer,
        }}
      >
        {
          <Card
            bg="success"
            style={{
              width: "100%",
              color: "white",
              textAlign: "center",
            }}
            className="mb-2"
          >
            <Card.Header className="fs-4">
              Change SideBar Color Card
            </Card.Header>
            <Card.Body>
              <Card.Text>
                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid red",
                    borderRadius: "50%",
                    background: "red",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("red")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid blue",
                    borderRadius: "50%",
                    background: "blue",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("blue")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid green",
                    borderRadius: "50%",
                    background: "green",
                    marginLeft: "10px   ",
                  }}
                  onClick={() => changeColor("green")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid orange",
                    borderRadius: "50%",
                    background: "orange",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("orange")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #B24C63",
                    borderRadius: "50%",
                    background: "#B24C63",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#B24C63")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #5438DC",
                    borderRadius: "50%",
                    background: "#5438DC",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#5438DC")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #32E875",
                    borderRadius: "50%",
                    background: "#32E875",
                    marginLeft: "10px   ",
                  }}
                  onClick={() => changeColor("#32E875")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #56EEF4",
                    borderRadius: "50%",
                    background: "#56EEF4",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#56EEF4")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #D8D8D8",
                    borderRadius: "50%",
                    background: "#D8D8D8",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#D8D8D8")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #FFED66",
                    borderRadius: "50%",
                    background: "#FFED66",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#FFED66")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #00CECB",
                    borderRadius: "50%",
                    background: "#00CECB",
                    marginLeft: "10px   ",
                  }}
                  onClick={() => changeColor("#00CECB")}
                  type="submit"
                  value=""
                />

                <input
                  style={{
                    width: "50px",
                    height: "50px",
                    border: "1px solid #A7A2A9",
                    borderRadius: "50%",
                    background: "#A7A2A9",
                    marginLeft: "10px",
                  }}
                  onClick={() => changeColor("#A7A2A9")}
                  type="submit"
                  value=""
                />
              </Card.Text>
            </Card.Body>
          </Card>
        }
      </Content>
    </div>
  );
};

export default AppContent;
